window.bookSummaryJSON = "<p><b>When Mallon the Undying threatened the land years ago, the elves stopped him - and then disappeared. </b></p> <p>Now Mallon's followers seek to bring him back to finish what he started.&nbsp;</p> <p>Only the Keepers - storytellers, historians, and magic-wielders - are left to stand against them.</p> <p>Alaric, who betrayed everything he believed to save his wife - and still failed.</p> <p>Will, a storyteller whoâ€™s convinced his weak magic makes him useless.&nbsp;</p> <p>And Sini, a former slave girl with unimaginable power but no way to wield it.&nbsp;</p> <p>Can they survive being hunted by dragons, attacked by frost goblins, and betrayed by traitors in their midst?&nbsp;</p> <p>Or will Mallon's minions overwhelm them and plunge the land into darkness?&nbsp;</p> <p><i>Fans of Patrick Rothfuss, David Eddings, and Terry Brooks will love this engaging trilogy. Dive into this enchanting epic fantasy series fans call \"heart-pounding, emotional, and very satisfying\".</i></p>"; 
